import json
from typing import Dict, List

from django.contrib.auth.models import User
from django.test import TestCase, Client
from rest_framework.reverse import reverse

from repo.models import Image


class ImageClient:
    def __init__(self):
        self.client = Client()

    def login(self, username: str, password: str):
        return self.client.login(username=username, password=password)

    def logout(self):
        return self.client.logout()

    def image_list(self):
        return self.client.get(reverse('images-list'))

    def image_create(self, image_data: Dict):
        return self.client.post(reverse('images-list'),
                                image_data)

    def image_delete(self, image_id: int):
        return self.client.delete(reverse('images-detail', args=[image_id, ]))

    def image_create_multiple(self, data: List[Dict]):
        return self.client.post(reverse('images-create_multiple'),
                                json.dumps(data),
                                content_type='application/json')

    def image_delete_multiple(self, id_list: List[int]):
        ids_as_str = ','.join([str(id) for id in id_list])
        return self.client.delete(reverse('images-delete_multiple')
                                  + f"?ids={ids_as_str}")


class TestImages(TestCase):
    username1 = 'user1'
    username2 = 'user2'
    password = 'xxxdscfdsvsfd'
    image = ""

    @classmethod
    def setUpClass(cls):
        super().setUpClass()
        cls.user1 = User.objects.create_user(cls.username1, f'{cls.username1}@a.com', cls.password)
        cls.user2 = User.objects.create_user(cls.username2, f'{cls.username2}@a.com', cls.password)
        cls.cli = ImageClient()

    def test__create_image__green(self):
        # arrange
        self.cli.login(self.username1, self.password)
        # act
        res = self.cli.image_create(
            {'public': True, 'image': self.image})
        # assert
        self.assertEquals(201, res.status_code)

    def test__create_image__bad_image__fail(self):
        # arrange
        self.cli.login(self.username1, self.password)
        # act
        res = self.cli.image_create(
            {'public': True, 'image': self.image[1:12]})
        # assert
        self.assertEquals(201, res.status_code)

    def test__create_image__not_logged_in__returns_401(self):
        # arrange
        # act
        res = self.cli.image_create(
            {'public': True, 'image': self.image})
        # assert
        self.assertEquals(403, res.status_code)

    def test__delete_image__green(self):
        # arrange
        self.cli.login(self.username1, self.password)
        self.cli.image_create(
            {'public': True, 'image': self.image})
        image = Image.objects.filter(owner=self.user1).first()
        # act
        res = self.cli.image_delete(image.id)
        # assert
        self.assertEquals(204, res.status_code)

    def test__delete_image__not_logged_in__returns_401(self):
        # arrange
        self.cli.login(self.username1, self.password)
        self.cli.image_create(
            {'public': True, 'image': self.image})
        image = Image.objects.filter(owner=self.user1).first()
        self.cli.logout()
        # act
        res = self.cli.image_delete(image.id)
        # assert
        self.assertEquals(403, res.status_code)

    def test__delete_image__owned_by_other__returns_forbidden(self):
        # arrange
        self.cli.login(self.username1, self.password)
        self.cli.image_create(
            {'public': True, 'image': self.image})
        image = Image.objects.filter(owner=self.user1).first()
        self.cli.login(self.username2, self.password)
        # act
        res = self.cli.image_delete(image.id)
        # assert
        self.assertEquals(403, res.status_code)

    def test__create_muliple__green(self):
        # arrange
        self.cli.login(self.username1, self.password)
        data = [
            {'public': True, 'image': self.image},
            {'public': True, 'image': self.image},
            {'public': True, 'image': self.image},
        ]
        # act
        res = self.cli.image_create_multiple(data)
        # assert
        self.assertEquals(201, res.status_code)
        self.assertEquals(len(data), Image.objects.filter(owner=self.user1).count())

    def test__create_muliple__bad_item__partially_create(self):
        # arrange
        self.cli.login(self.username1, self.password)
        data = [
            {'public': True, 'image': self.image},
            {'public': True, 'image': self.image},
            {'image': ''},
        ]
        # act
        res = self.cli.image_create_multiple(data)
        # assert
        self.assertEquals(201, res.status_code)
        self.assertEquals(len(data) - 1, Image.objects.filter(owner=self.user1).count())

    def test__delete_muliple__green(self):
        # arrange
        self.cli.login(self.username1, self.password)
        data = [
            {'public': True, 'image': self.image},
            {'public': True, 'image': self.image},
            {'public': True, 'image': self.image},
        ]
        self.cli.image_create_multiple(data)
        image_ids = Image.objects.filter(owner=self.user1).values_list('id', flat=True)
        # act
        res = self.cli.image_delete_multiple(image_ids)
        # assert
        self.assertEquals(200, res.status_code)
        self.assertEquals(0, Image.objects.filter(owner=self.user1).count())

    def test__delete_muliple__bad_id__should_create_partially(self):
        # arrange
        self.cli.login(self.username1, self.password)
        data = [
            {'public': True, 'image': self.image},
            {'public': True, 'image': self.image},
            {'public': True, 'image': self.image},
        ]
        self.cli.image_create_multiple(data)
        image_ids = list(Image.objects.filter(owner=self.user1).values_list('id', flat=True))
        image_ids.append('bad_id')
        # act
        res = self.cli.image_delete_multiple(image_ids)
        # assert
        self.assertEquals(200, res.status_code)
        self.assertEquals(0, Image.objects.filter(owner=self.user1).count())

    def test_image_list__green(self):
        # arrange
        self.cli.login(self.username1, self.password)
        # act
        res = self.cli.image_list()
        # assert
        self.assertEquals(200, res.status_code)
